import "./style.scss";
import bgImg from "../../assets/pexels-photo-2007647.jpeg";

function PageConnexionReactJs() {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100">
      <div className="bg-white shadow-md rounded-lg overflow-hidden flex flex-row">
        <div className="w-3/5">
          <img src={bgImg} alt="Image" className="w-full h-auto" />
        </div>
        <div className="w-1/2">
          <h2 className="text-2xl font-semibold mb-4">Inscription</h2>
        </div>
      </div>
    </div>
  );
}
export default PageConnexionReactJs;
